def get_artifact_cells(artifact):
    result = []
    if artifact[0]==artifact[2] and artifact[1]==artifact[3]:
        result = [(artifact[0], artifact[1])]
        return result
    else:
        if artifact[0]== artifact[2]:
            col = artifact[1]
            while col<=artifact[3]:
                result.append((artifact[0], col))
                col = col + 1
            return result
        
        if artifact[1] == artifact[3]:
            row = artifact[0]
            while row<= artifact[2]:
                result.append((row, artifact[1]))
                row = row + 1
            return result
        
        left_top = (artifact[0], artifact[1])
        right_bottom = (artifact[2], artifact[3])
        right_top = (artifact[0], artifact[1] + 1)
        left_bottom = (artifact[0] + 1, artifact[1])
        result = [left_top, right_top, left_bottom, right_bottom]
        return result

def digArtifacts(n, artifacts, dig):
        dig_map = set()
        end_dig = len(dig)
        result1 = 0
        for i in range(end_dig):
            dig_map.add(tuple(dig[i]))
        
        end_arti = len(artifacts)
    
        for i in range(end_arti):
            artifact_cells = get_artifact_cells(artifacts[i])
            end = len(artifact_cells)
            add_artifact = True
            for j in range(end):
                if  artifact_cells[j] not in dig_map:
                    add_artifact = False
                    break
            if add_artifact:
                result1 = result1 + 1
        return result1

